field_91.介绍内容:
第一个男宝从3个月带到1岁，就送到甘肃姥姥家了;
第二个女孩从5个月带到2岁半，上幼儿园了所以我下户了；
第三个是替班了一个月子里的男孩；
第四个是个10个月的女宝，带到1岁半，因这个孩子比较乖，她妈妈一直没请阿姨，但是见她10个月还不会爬，着急了来找我们公司要阿姨引导一下，我上户后用她最喜欢的玩具和东西引导她，而且自己还在地上跟她一起爬，她慢慢地就爬得很好了，到1岁4个多月后也走的挺利索了，我也就下来了;
第五个是对3个月双胞胎，跟阿姨一起带的，由于那个阿姨睡觉呼噜太大，四个人又睡一个房间，晚上睡不好所以我就下了;
第六个是个男孩，从刚出月带到1岁半，他们一家去三亚了，要开春时才回来。
